import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import {determineDistanceBetweenDriverPatient} from '../Geolocation/locationServices';
import { useSelector } from 'react-redux'
import determineLatLongFromAddress from '../Geolocation/locationServices'
import driversList from '../Model/driverModel';

export default function CheckboxListSecondary() {

  const address = useSelector(
    (patientData => patientData.pickupAddress));

  const [displayDrivers, setDisplayDrivers] = React.useState(null);
  const calculateNearestDriver = async() => {
    const {lat, lng} = await determineLatLongFromAddress(address);
    var optimumDriverList = [];
    driversList.forEach(function (driver) {
      const lat1 = driver.latitude;
      const lng1 = driver.longitude;

      var distance = determineDistanceBetweenDriverPatient(lat, lng, lat1, lng1);
      const driverData = {id: driver.driverID, driverName: driver.name, vehicleId: driver.vehicleId, 
        distanceFromPatient: distance};

      optimumDriverList.push(driverData);
    });
    optimumDriverList.sort(function(a,b){
      return a.distanceFromPatient - b.distanceFromPatient
    });

    setDisplayDrivers(optimumDriverList);

  }

  return (
  <div onLoad={() =>calculateNearestDriver()}>
    <List dense sx={{ width: '100%', maxWidth: 360}}>
      {driversList.map((value) => {
        const labelId = `checkbox-list-secondary-label-${value.driverID}`;
        return (
          <ListItem key={value.vehicleId}>
            <ListItemButton>
              <ListItemAvatar>
                <Avatar
                  src={`/static/images/avatar/${value + 1}.jpg`}
                />
              </ListItemAvatar>
              <ListItemText id={labelId} primary={value.name} />
            </ListItemButton>
          </ListItem>
        );
      })}
    </List>
  </div>
  );
}
